// ==UserScript==
// @name         PhpStormRESTControl
// @version      0.2
// @author       Michael WÃ¶lk
// @description  (!!!) ATTENTION/IMPORTANT: Adapt @match below to your real host
// @match        https://sentry.*
// @require      https://code.jquery.com/jquery-3.6.1.min.js
// @require      https://raw.githubusercontent.com/uzairfarooq/arrive/master/minified/arrive.min.js
// ==/UserScript==

this.$ = this.jQuery = jQuery.noConflict(true);

(function () {

  const msInitOnReady = 200;
  const startPort = 8100;
  const maxPort = 8110;

  function send(port, file = '', line = 0) {

    const url = 'http://localhost:' + port + '/?file=' + encodeURIComponent(file) + '&line=' + line;

    console.log('send url', url);
    return $.ajax({
      url,
      type: "GET",
      port
    });

  }

  function sendBatch(file = '', line = 0) {

    for (let port = startPort; port <= maxPort; port++) {
      send(port, file, line);
    }

  }

  function init(elements) {

    elements.each(function (i, sel) {
      const span = '<span class="phpstormIcon" style="cursor: pointer;"><img src="data:image/png;base64, " height="16"/></span>&nbsp;'
      $(sel).not(':has(span.phpstormIcon)').prepend(span);
    });

    $('.phpstormIcon').click(function (event) {
      event.stopPropagation();
      const $parent = $(this).parent('.filename').parent();
      let filename = $parent.find('.filename span span').text();
      const line = $parent.find('.lineno').text();
      console.log("thisparent", $parent);
      console.log("click", filename);
      console.log("lineno" , line);
      filename = filename.replace('/var/www/html', '');
      if (filename === null) {
        return;
      }
      // sendBatch(filename);
      sendBatch(filename, line);
    });

  }

  function initOnReady() {
    console.log("started")
    setTimeout(function tick() {
      const elements = $('.filename');
      console.log("element", elements)
      if (elements.length > 0) {
        init(elements);
      } else {
        setTimeout(tick, msInitOnReady);
      }
    }, msInitOnReady);
  }

  // $('[role="tabpanel"]').arrive('.function span', initOnReady);
  // $(document).ready(initOnReady);
  document.arrive('section', initOnReady);

})();
